import Link from 'next/link';

const Menu = () => {
  return (
    <div id="menu">
      <Link href="/">
        <a>Home</a>
      </Link>

      <Link href=" /sobre">
        <a>Sobre</a>
      </Link>

      <Link href=" /contato">
        <a>Contato</a>
      </Link>
    </div>
  );
};
export default Menu;
